import React, { Component } from "react";

export default class Sample2 extends Component {
  constructor() {
    super();

    this.state = {
      name: "nithish",
    };
  }
  mybtn = () => {
    alert("hiiii");
  };

  render() {
    return (
      <div>
        <h1>{this.state.name}</h1>
        <button onClick={this.mybtn}>click</button>
      </div>
    );
  }
}
